sample: '["\"La Escala de Observaci\u00f3n para el Diagn\u00f3stico del Autismo \u2013
  2 (ADOS-2) es una evaluaci\u00f3n estandarizada y semiestructurada de la comunicaci\u00f3n,
  la interacci\u00f3n social y el juego o el uso imaginativo de materiales para personas
  con sospecha de tener un trastorno del espectro autista.\\nLa escala est\u00e1 estructurada
  en cinco m\u00f3dulos (T, 1, 2, 3 y 4), cada uno destinado a personas con una edad
  cronol\u00f3gica y un nivel de lenguaje determinado. El ADOS-2 se puede aplicar
  a personas de edades, niveles de desarrollo y comunicaci\u00f3n verbal muy diferentes
  (desde ni\u00f1os a partir de los 12 meses a adultos, desde aquellos sin habla a
  aquellos con un habla fluida).\\nCada uno de los m\u00f3dulos est\u00e1 compuesto
  por un conjunto de actividades que proporcionan contextos estandarizados donde el
  evaluador puede observar o no la presencia de ciertos comportamientos sociales y
  comunicativos relevantes para el diagn\u00f3stico del TEA. Tras corregir el protocolo
  y obtener las puntuaciones del algortimo, se podr\u00e1 realizar el diagn\u00f3stico
  a partir de los puntos de corte establecidos.\\nComo principal novedad en el ADOS-2
  se incluye un nuevo m\u00f3dulo para los ni\u00f1os m\u00e1s peque\u00f1os (12 \u2013
  30 meses), el m\u00f3dulo T. Adem\u00e1s, se han actualizado el manual y los protocolos
  de todos los m\u00f3dulos, con pautas mejoradas para la aplicaci\u00f3n, codificaci\u00f3n
  e interpretaci\u00f3n, y, en el caso de los m\u00f3dulos 1, 2 y 3, tambi\u00e9n
  se presentan nuevos algoritmos revisados. Finalmente, el ADOS-2 tambi\u00e9n incluye
  una nueva puntuaci\u00f3n comparativa para determinar el grado de severidad de los
  s\u00edntomas asociados al autismo observados, en el caso de los m\u00f3dulos 1,
  2 y 3.\\nPREGUNTAS FRECUENTES\\n\u00bfQui\u00e9n pasa el test ADOS-2?\\nRecuerda,
  el test ADOS-2 debe ser administrado por un profesional experimentado en autismo\\ny
  certificado para realizarlo. Si al principio, tienes dudas al pasar esta prueba,
  puedes pedir\\nayuda a alg\u00fan otro profesional, que lleve m\u00e1s tiempo pasando
  dicha prueba. Esta prueba es\\ndetallada y completa, pero la experiencia del evaluador
  es clave para poder aplicarla\\ncorrectamente.\\n\u00bfEn qu\u00e9 edades se aplica?\\nA
  partir de los 12 meses de edad, hasta personas adultas.\\n\u00bfEn qu\u00e9 consiste
  la evaluaci\u00f3n?\\nLa evaluaci\u00f3n consiste en una observaci\u00f3n directa
  de comportamientos socio-comunicativos y\\ncomportamientos repetitivos que definen
  los criterios diagn\u00f3sticos de TEA, seg\u00fan DSM-5.\\nDependiendo de la edad
  que tenga la persona, tambi\u00e9n su nivel de lenguaje, se elige uno de 5\\nm\u00f3dulos
  para evaluar los comportamientos de la persona.\\n\u00bfQu\u00e9 otras pruebas se
  pueden utilizar para diagnosticar autismo?\\nEl ados-2 se complementa con otras
  pruebas como pueden ser:\\nAdi-r: es una entrevista diagn\u00f3stica que se rellena
  conjuntamente con las familias. Obtiene\\ndescripciones y comportamientos detallados
  que son necesarios para establecer un diagn\u00f3sticoen autismo\\nMchat: es una
  prueba diagn\u00f3stica que se administra entre los 6 meses y los 30 meses de edad.\\nConsta
  de 20 preguntas, que los profesionales realizan a los padres del menor que se\\nsospecha
  que pueda tener TEA.\\nSe pueden complementar todo ello con otras pruebas diagn\u00f3sticas.\\n\u00bfQu\u00e9
  puedo hacer para pasar dicha prueba?\\nSer profesional habilitado para poder diagnosticar
  en autismo y adem\u00e1s realizar una formaci\u00f3n\\nespec\u00edfica sobre dicha
  prueba.\\n\u00bfCu\u00e1l es el objetivo del curso de ados-2?\\nEl objetivo es introducir
  al uso de la herramienta diagn\u00f3stica ADOS-2: como se administra,\\nrealizar
  su valoraci\u00f3n y su validez diagnostica y su incorporaci\u00f3n dentro de la
  pr\u00e1ctica\\n\u00bfD\u00f3nde puedo realizar el curso de Ados-2?\\nEn Asociaci\u00f3n
  Infortea realizamos cursos sobre autismo durante todo el a\u00f1o, dirigidos a\\nprofesionales
  que est\u00e9n interesados en dicha formaci\u00f3n.\\nPuedes consultar la web www.infortea.com\\nPor
  Maria Cruz Herrero Garcia\\nProfesora en Servicios a la comunidad\\nExperta en Autismo\"",
  "\"Publica tus Notas de Prensa Gratis\\nPublique GRATIS sus notas de prensa y promocione
  su web. Aumente la visibilidad de su sitio web con notas de prensa en internet.
  Para que tu nota de prensa sea aceptada debes tener muy en cuenta nuestra normativa.
