  que utiliza las tiras c\u00f3micas como fuente de inspiraci\u00f3n.\"", "\"Contents\\n-
  1 \u00bfC\u00f3mo se descongelan los mejillones?\\n- 2 \u00bfC\u00f3mo saber si
  los mejillones congelados est\u00e1n buenos?\\n- 3 \u00bfC\u00f3mo calentar unos
  mejillones cocidos?\\n- 4 \u00bfC\u00f3mo preparar mejillones en vino blanco?\\n-
  5 \u00bfQu\u00e9 pasa si se congelan los mejillones?\\n- 6 \u00bfQu\u00e9 pasa si
  se congelan los mejillones vivos?\\n- 7 \u00bfCu\u00e1nto tiempo se pueden tener
  los mejillones en la nevera?\\n- 8 \u00bfQu\u00e9 pasa con los mejillones que no
  se abren?\\n- 9 \u00bfCu\u00e1nto tiempo duran los mejillones frescos en la nevera?\\n-
  10 \u00bfC\u00f3mo se pueden comer los mejillones?\\n\u00bfC\u00f3mo se descongelan
  los mejillones?\\nEn el caso de los mejillones, os recomiendo sumergirlos unos segundos
  en agua tibia con sal nada m\u00e1s sacarlos del congelador y dejarlos reposar a
  continuaci\u00f3n, durante aproximadamente 5 minutos, entre 2 l\u00e1minas de papel
  de cocina para que absorban los restos de escarcha y el exceso de humedad acumulada.\\n\u00bfC\u00f3mo
  saber si los mejillones congelados est\u00e1n buenos?\\nPara comprobarlo, puedes
  dar un peque\u00f1o golpecito en el exterior de alguna pieza que est\u00e9 parcialmente
  abierta, si el mejill\u00f3n reacciona cerr\u00e1ndose, perfecto; por el contrario,
  si no se cierra ante el toque, mejor desecharlo.\\n\u00bfC\u00f3mo calentar unos
  mejillones cocidos?\\nPuedes recalentar los mejillones sac\u00e1ndolos de sus conchas
  y poni\u00e9ndolos r\u00e1pidamente en el microondas en un peque\u00f1o plato cubierto
  con una toalla de papel h\u00fameda. Siempre debes recalentar los mejillones por
  separado de cualquier caldo o plato del que formen parte, a\u00f1adi\u00e9ndolos
  despu\u00e9s de recalentar el resto del plato.\\n\u00bfC\u00f3mo preparar mejillones
  en vino blanco?\\nLave bien los mejillones en agua fr\u00eda, retire las barbas
  de cada mejill\u00f3n. En una olla grande, derrita la mantequilla a fuego medio,
  agregue los chalotes o cebolla y el ajo. Cocine hasta que los chalotes se pongan
  suaves y transparentes, aproximadamente unos 3-5 minutos. Agregue los mejillones
  y mezcle bien.\\n\u00bfQu\u00e9 pasa si se congelan los mejillones?\\nSi congelas
  la carne de los mejillones y su caldo por separado en envases sellados herm\u00e9ticamente,
  podr\u00e1n mantenerse durante 4 meses. Apurando al m\u00e1ximo los tiempos de congelado,
  pueden aguantar hasta los 6 meses, pero despu\u00e9s de este periodo es mejor no
  consumirlos.\\n\u00bfQu\u00e9 pasa si se congelan los mejillones vivos?\\nNo se
  recomiendan congelar los mejillones vivos, lo cu\u00e1les estar\u00e1n con su concha
  cerrada y sin cocinar. En cuanto al tiempo en el que estos se mantienen vivos y
  por tanto aptos para su cocina, se recomiendan cocinarlos en 2 o 3 d\u00edas despu\u00e9s
  de su compra, como muy tarde.\\n\u00bfCu\u00e1nto tiempo se pueden tener los mejillones
  en la nevera?\\nUna vez comprados, los mejillones deben ser cocinados cuanto antes.
  Para conservarlos, es mejor cocinarlos y conservarlos cocidos. Sin embargo es posible
  conservarlos hasta 2 d\u00edas en el frigor\u00edfico. Para ello debemos mojar un
  pa\u00f1o en agua con sal, envolver los mejillones y hacer un nudo fuerte para que
  no se abran.\\n\u00bfQu\u00e9 pasa con los mejillones que no se abren?\\nLos moluscos
  de dos valvas -almejas, ostras, chirlas, mejillones, etc. Si despu\u00e9s de la
  cocci\u00f3n alguno de estos moluscos permanece cerrado, eso quiere decir que ya
  estaba muerto antes de ser cocinado, de ah\u00ed que sus m\u00fasculos no reaccionen
  con el calor.\\n\u00bfCu\u00e1nto tiempo duran los mejillones frescos en la nevera?\\nTres
  o cuatro d\u00edas como m\u00e1ximo. En la nevera lo puedes conservar frescos envueltos
  en un pa\u00f1o h\u00famedo hasta que los cocines y en la zona menos fr\u00eda de
  la nevera.\\n\u00bfC\u00f3mo se pueden comer los mejillones?\\n\u201cSaca la carne
  y luego usa la concha para comerte todos los mejillones. Es muy elegante\u201c.
  Ella lo demostr\u00f3. De hecho, usar una c\u00e1scara de mejill\u00f3n como un
  utensilio \u2014para zafar la carne y comerla\u2014 es mucho m\u00e1s digno que
  cortar con los dedos y mucho m\u00e1s sencillo que usar tenedores, que requieren
  lavado.\"", "\"Puntuaci\u00f3n media 0 votos\\n1 de 10\\nAden Stone, un adolescente
