  Si quieres, s\u00e9 el primero en dejar un comentario. Seguro que alg\u00fan usuario
  se anima despu\u00e9s de leerlo.\"", "\"Este volumen, editado en peque\u00f1o formato,
  contiene un glosario de t\u00e9rminos b\u00e1sicos de gastronom\u00eda y 59 breves
  \u00abbocados literarios\u00bb de autores espa\u00f1oles e hispanoamericanos, acompa\u00f1ados
  por las correspondientes recetas para elaborar esos alimentos. A lo largo de sus
  204 p\u00e1ginas, El sabor de la e\u00f1e pasa revista a la estrecha relaci\u00f3n
  entre las palabras y la comida e invita a saborear la literatura en espa\u00f1ol
  a trav\u00e9s de las innumerables referencias a nuestras delicias culinarias en
  las obras literarias contempor\u00e1neas.\"", "\"\u00bfEst\u00e1s en busca de personal?,
  \u00bftienes una vacante?, o \u00bfest\u00e1s en expansi\u00f3n?.\\nTan solo en
  el a\u00f1o 2017 el sector automotriz dio empleo a 839 mil 571 personas en sus distintas
  \u00e1reas, representando m\u00e1s del 22% de la industria manufacturera en M\u00e9xico,
  marcando un r\u00e9cord hist\u00f3rico; como lo demuestran datos del Instituto Nacional
  de Estad\u00edstica y Geograf\u00eda (INEGI). Esto quiere decir una cosa, no tendr\u00e1s
  falta de aspirantes, sin embargo, cuando hablamos de contratar a un nuevo integrante
  en un equipo de ventas formamos expectativas y estas llevan consigo de forma inherente
  cierto grado de incertidumbre. Una decisi\u00f3n a la ligera puede traer consecuencias
  que van m\u00e1s all\u00e1 de una p\u00e9rdida de tiempo.\\nCon relaci\u00f3n al
  reclutamiento y selecci\u00f3n de la persona correcta te presentamos recomendaciones
  por dos expertos, John R. Treace con trayectoria en el \u00e1mbito de equipos de
  venta y Brian Tracy autor de Contratando y despidiendo (Hiring & Firing, New York:
  American Management Association). La elecci\u00f3n de candidatos no es una tarea
  sencilla y en ocasiones la falta de enfoque puede hacernos pensar incluso que se
  trata de buena o mala suerte. En G20 Inc pensamos que este proceso debe tratarse
  y practicarse como una habilidad m\u00e1s de liderazgo y as\u00ed poder contribuir
  a desarrollar el potencial de tu equipo u organizaci\u00f3n.\\nSabemos que terminar
  con la relaci\u00f3n laboral del personal es algo serio, dif\u00edcil, estresante
  y en ocasiones puede traer consecuencias que pueden durar a\u00f1os en reparar.
  Para reducir las posibilidades de pasar por este penoso proceso, la clave est\u00e1
  en desarrollar habilidades para reclutar, contratar y construir un equipo eficiente
  y competente, aqu\u00ed abordaremos algunas que pueden ayudarte. Recordemos que
  en el mundo moderno; todo trabajo esta hecho por equipos, grupos de personas trabajando
  juntos e interactuando hacia una predeterminada meta, por ello, sabemos que la importancia
  de seleccionar los miembros de un equipo es critica para el \u00e9xito de la concesionaria.\\n\u201cPara
  que puedas tener un equipo de vendedores sin\u00e9rgico, debes concentrarte en qui\u00e9n
  contratas por encima de a qui\u00e9n despides\u201d. Seg\u00fan recomienda John
  R. Treace, autor del Best Seller: C\u00f3mo construir una organizaci\u00f3n de vendedores
  de alta velocidad en la enorme librer\u00eda digital de Amazon. Con su larga carrera
  en el campo automotriz y su valioso aprendizaje nos ayudar\u00e1 a encontrar la
  persona correcta en el lugar indicado y construir equipos de venta de alto rendimiento,
  ya que finalmente eso es lo que buscamos, \u00bfcierto?\\nReferencias. Hoy en d\u00eda
  los estudiantes aprenden c\u00f3mo manejar una entrevista y redactar curr\u00edculos
  llamativos o con dise\u00f1os impresionantes, es por ello que en este punto, las
  referencias se tornan m\u00e1s importantes, intenta averiguar lo m\u00e1s que puedas
  acerca de tu candidato. No dudes en comunicarte con sus referencias mencionadas
  o mejor a\u00fan, indagar alguna referencia que no est\u00e9 en su listado.\\n\u00c9xito.
  Revisa, si hay alg\u00fan logro que est\u00e9 por encima de la media, si es un logro
  genuino y adem\u00e1s puedes referenciarlo, es muy probable que lo repita con las
  mismas dimensiones o que pueda alcanzar algo a\u00fan mejor. Indaga en la entrevista
  los detalles del \u00e9xito mencionado y cuestiona c\u00f3mo podr\u00eda mejorarlo.\\nPrueba
  final. Quiz\u00e1s podr\u00edas estar en una situaci\u00f3n en la que tienes varios
  postulantes finales y no puedes decidir con claridad, para determinar qui\u00e9n
  realmente desea y conseguir\u00e1 este puesto. Aplica una prueba final, por ejemplo,
  necesitas un plan de ventas emergente acerca de una unidad a vender, establece una
  fecha y hora l\u00edmite. Puede parecer algo atrevido, pero sin duda, muy clarificante.\\nCorrespondencia.
  Uno de los consejos m\u00e1s importantes es tener clara la correspondencia entre
  la persona correcta en el puesto correcto. El punto aqu\u00ed es identificar esa
  situaci\u00f3n. Posiblemente te dar\u00e1s cuenta cuando alguno de los candidatos
  comunique un detalle curioso como lo pueden ser: datos hist\u00f3ricos de la compa\u00f1\u00eda,
  especificaciones sobre el producto, la forma en que percibe a los clientes, la forma
  en que se apasiona por el puesto, entre otros detalles significativos.\\nEn esta
  segunda parte, te compartimos la visi\u00f3n de Brian Tracy, orador profesional
  y chairman de Brian Tracy International Training & Consulting Company, quien tambi\u00e9n
  cuenta con excelentes recomendaciones creadas a lo largo de su carrera. Para que
  tengas m\u00e1s conciencia de un proceso de contrataci\u00f3n exitoso y lo m\u00e1s
  importante; que sea la persona correcta en el puesto correcto, veamos algunas de
  las experiencias m\u00e1s significativas en su vida:\\nLey de Tres. Se refiere a
  tener por lo menos tres buenos candidatos, de igual manera, entrevistar al favorito
  por lo menos tres veces y por \u00faltimo, entrevista a esa persona por lo menos
  en tres distintos lugares. Esto significa que cuando est\u00e9s en busca de personal,
  cuenta por lo menos con tres personas, no importa qu\u00e9 tan buenos parezcan ser
  en la primera entrevista, en la segunda notar\u00e1s alguna diferencia y para la
  tercera tendr\u00e1s mayor seguridad. Una de sus reglas es que \u201cLos candidatos
  nunca se ver\u00e1n mejor en su vida que en la primer entrevista\u201d. Es en ese
  primer encuentro cuando el solicitante querr\u00e1 impresionarte, sostener una buena
  imagen o perderla podr\u00eda ser significar algo definitivo.\\nOtra forma de aplicar
  la Ley de Tres es que el candidato sea entrevistado por al menos tres personas m\u00e1s,
  puedes presentarlo a otros miembros de tu staff, para que conversen acerca del puesto
  y de alg\u00fan otro tema que salga a colaci\u00f3n. Posteriormente, llevar a cabo
  una reuni\u00f3n de evaluaci\u00f3n del candidato en donde los tres o cuatro entrevistadores
  presenten sus observaciones y se discuta en equipo la informaci\u00f3n.\\nCuestiones
  b\u00e1sicas. \u00bfMe cae bien esta persona?, nunca contrates a alguien que no
  te agrada, el clima laboral en tu equipo es una mezcla de personalidades juntas
  y una persona negativa puede ser el veneno que afecte las actitudes y el desempe\u00f1o
  de los dem\u00e1s. Una pregunta gu\u00eda para resolver este conflicto puede ser
  \u00bfme sentir\u00eda c\u00f3modo invitando a esta persona a cenar a mi casa?,
  \u00bfcon mi familia?.\\nTu coraz\u00f3n. No menos importante, escucha tu instinto,
  tu voz interior, Sigmund Freud realiz\u00f3 este ejercicio alguna vez cuando tuvo
  que tomar una decisi\u00f3n muy importante: lanzar una moneda al aire, no te apresures,
  no queremos que lo dejes al azar, pero seg\u00fan Freud, cuando la moneda est\u00e1
  en el aire es cuando realmente sabes que lado quieres obtener.\\nUna vez que hayas
  tenido \u00e9xito, quiz\u00e1s despu\u00e9s de algunas batallas; recuerda siempre
  ayudar a mejorar el desempe\u00f1o de tu equipo continuamente, ah\u00ed es donde
  demuestras tus verdaderas cualidades de liderazgo y tu habilidad para dirigir personas
