  "\"Se implementar\u00e1 una guardia de personal operativo para atender situaciones
  emergentes\\nLos Cabos, Baja California Sur.- Manuel Salvador Castro Cese\u00f1a,
  director general del Sistema Municipal DIF afirm\u00f3 que durante las vacaciones
  de verano, no se descuida la atenci\u00f3n a la ciudadan\u00eda, por ello se han
  realizado guardias donde se cuenta con personal para atender a la ciudadan\u00eda
  como se merece.\\nEl primer periodo vacacional inicia el 17 de julio y el segundo
  periodo el 7 de agosto. Dejando claro que a las personas que tengan m\u00e1s de
  6 meses ininterrumpidos y menos de 10 a\u00f1os, tienen derecho a 10 d\u00edas h\u00e1biles,
  mientras que aquellos que tienen m\u00e1s de 10 a\u00f1os de servicio tienen derecho
  a 15 d\u00edas.\\nExpres\u00f3 el funcionario que es instrucci\u00f3n de la presidenta
  del Sistema Municipal DIF Vianey N\u00fa\u00f1ez de De La Rosa, que no se descuide
  la atenci\u00f3n a la ciudadan\u00eda,\\nPor ello se dejar\u00e1 una guardia que
  atender\u00e1 asuntos emergentes que se presenten durante el periodo vacacional.\"",
  "\"2021\\nLa adaptaci\u00f3n gana cada vez m\u00e1s espacio en el debate global
  sobre el cambio clim\u00e1tico, en la medida que los impactos del aumento de temperatura
  sobre el clima, los ecosistemas y las sociedades se hacen m\u00e1s evidentes.\\nLa
  reciente publicaci\u00f3n \u201cAdaptaci\u00f3n al cambio clim\u00e1tico en los
  Andes: Vac\u00edos y prioridades para la gesti\u00f3n del conocimiento\u201d del
  Consorcio para el Desarrollo Sostenible de la Ecoregi\u00f3n Andina se ubica en
  este contexto, proporcionando orientaci\u00f3n para la investigaci\u00f3n y la toma
  de decisi\u00f3n en la regi\u00f3n.\\nCordillera Real de Bolivia\\nAdaptaci\u00f3n
  al cambio clim\u00e1tico en los Andes\\n\u201cLa adaptaci\u00f3n al cambio clim\u00e1tico
  (ACC) se ha convertido en un tema prioritario en la agenda cient\u00edfica y de
  gesti\u00f3n en torno a la relaci\u00f3n entre el desarrollo sostenible y el cambio
  clim\u00e1tico (CC) a nivel global y en los Andes\u201d, constatan los autores de
  la m\u00e1s reciente publicaci\u00f3n del Consorcio para el Desarrollo Sostenible
  de la Ecoregi\u00f3n Andina (CONDESAN). Esta falta de estudios y de conocimientos
  no es un tema meramente acad\u00e9mico: \u201cSin embargo, esta es una tem\u00e1tica
  muy amplia y no existe un an\u00e1lisis actualizado de las necesidades de conocimiento
  en torno a la adaptaci\u00f3n al CC en los Andes, que permita la identificaci\u00f3n
  de \u00e1reas prioritarias de trabajo para enfrentar los retos m\u00e1s urgentes
  impuestos por el cambio ambiental global\u201d.\\nPara poder orientar los esfuerzos
  y las inversiones para la adaptaci\u00f3n, es necesario conocer bien cu\u00e1les
  son los impactos del cambio clim\u00e1tico, y cu\u00e1les ser\u00e1n en el futuro
  - en los ecosistemas, pero tambi\u00e9n en las sociedades humanas relacionadas o
  dependientes de estos. En las palabras de los propios investigadores, Luis Daniel
  Llamb\u00ed y Alexandra Garc\u00e9s, \u201cel objetivo de este documento es identificar
  los principales vac\u00edos de conocimiento sobre los diferentes aspectos vinculados
  a la adaptaci\u00f3n al cambio clim\u00e1tico en la regi\u00f3n, incluyendo el an\u00e1lisis
  de los impactos del CC en los ecosistemas y sociedades andinas, as\u00ed como la
  gesti\u00f3n del conocimiento para orientar estrategias de implementaci\u00f3n de
  medidas de adaptaci\u00f3n al CC\u201d.\\nPara cumplir con el objetivo trazado,
  los autores han integrado los resultados de la revisi\u00f3n de la literatura y
  de las agendas de investigaci\u00f3n disponibles sobre el tema a nivel global y
  de los Andes, por una parte, con \u201cla experiencia acumulada por CONDESAN y otras
  instituciones de la regi\u00f3n en torno a la ACC y la visi\u00f3n de actores clave
  en los Andes incluyendo tomadores de decisi\u00f3n, expertos en el tema y actores
  involucrados en la implementaci\u00f3n de proyectos y soluciones de adaptaci\u00f3n\u201d.\\nEl
  resultado es una excelente publicaci\u00f3n de 62 p\u00e1ginas, con un sesgo regional
  en los Andes del norte, que se refleja en las entrevistas realizadas: Ecuador (15),
  Per\u00fa (9) y Colombia (7). Chile y Argentina cuentan con dos entrevistados por
  pa\u00eds, mientras que no aparece ning\u00fan entrevistado de Bolivia entre las
  44 personas de la lista de encuestados. El documento ha sido elaborado en el marco
  del Programa Adaptaci\u00f3n en las Alturas (A@A) y se encuentra disponible en formato
  pdf desde la p\u00e1gina web de CONDESAN.\\nReuni\u00f3n comunal en las monta\u00f1as,
  Hampaturi, Bolivia\\nConclusiones: vac\u00edos y oportunidades para la gesti\u00f3n
  del conocimiento\\nPresentamos a continuaci\u00f3n una versi\u00f3n abreviada de
  las conclusiones del estudio, donde se se\u00f1ala las \u201cprincipales necesidades
  para responder a las brechas, priorizadas a la luz del an\u00e1lisis realizado y
  las respuestas de los expertos y tomadores de decisi\u00f3n consultados\u201d:\\n-
  Existen vac\u00edos importantes en el conocimiento b\u00e1sico sobre el clima, el
  cambio clim\u00e1tico y sus impactos ecol\u00f3gicos y sociales en los Andes. Esto
  plantea la necesidad de seguir fortaleciendo los sistemas de monitoreo hidro-meteorol\u00f3gico
  en los Andes, as\u00ed como las redes de monitoreo de largo plazo e investigaci\u00f3n
  comparativa.\\n- Es necesario analizar c\u00f3mo diferentes acciones o soluciones
  de adaptaci\u00f3n generan cambios en la vulnerabilidad, resiliencia y capacidad
  adaptativa de los individuos, comunidades y socio-ecosistemas Andinos. La ausencia
  de herramientas consensuadas y la falta de experiencias que eval\u00faen las pol\u00edticas
  y estrategias de adaptaci\u00f3n al CC han limitado los procesos de generaci\u00f3n
  de s\u00edntesis y estudios comparativos sobre los impactos de estas estrategias
  y acciones de ACC. Esto plantea, la necesidad de proponer herramientas e indicadores
  (toolkits) para el monitoreo de proyectos o estrategias de ACC.\\n- Se requieren
  an\u00e1lisis comparativos de los enfoques, impactos y lecciones aprendidas de los
  proyectos y estrategias de adaptaci\u00f3n. Es importante entender c\u00f3mo los
  contextos institucionales y de gobernanza han influenciado el \u00e9xito o fracaso
  de las estrategias de adaptaci\u00f3n adoptadas. A su vez, es importante evaluar
  las estrategias que se han implementado para la r\u00e9plica y escalamiento de experiencias
  y la promoci\u00f3n de esquemas de sostenibilidad institucional y financiera (barreras
  y oportunidades).\\n- Es prioritario contar con an\u00e1lisis integrados y s\u00edntesis
  comparativas de los impactos del CC sobre el funcionamiento de los ecosistemas y
  los servicios ecosist\u00e9micos que prestan, los efectos de diferentes estrategias
  de uso del suelo y los beneficios de la restauraci\u00f3n y el manejo de los ecosistemas
  en los Andes bajo escenarios de CC. Estos an\u00e1lisis son relevantes para identificar
  diferentes opciones de adaptaci\u00f3n.\\n- Es necesario promover una visi\u00f3n
  m\u00e1s integral o multi-sectorial de las estrategias de adaptaci\u00f3n. Una oportunidad
  interesante es la generaci\u00f3n de estudios de s\u00edntesis o metaan\u00e1lisis
  en los que se analicen conjuntamente los proyectos y estrategias vinculados a la
  gesti\u00f3n de los recursos h\u00eddricos, los sistemas productivos y la AbE en
  la regi\u00f3n (incluyendo el an\u00e1lisis de sinergias y contradicciones). Para
  esto es importante partir de un enfoque transdiciplinario que analice los socioecosistemas
  considerando las dimensiones ambientales y ecol\u00f3gicas de las estrategias de
  adaptaci\u00f3n, as\u00ed como la oportunidades de inserci\u00f3n y los impactos
  potenciales en el contexto social, econ\u00f3mico y cultural.\\nLenguas de glaciar
  en retroceso, Nevado Illimani, Bolivia\\n- Se requiere promover procesos de sistematizaci\u00f3n
  y comparaci\u00f3n de diferentes estrategias de ACC basadas en estrategias tradicionales
  de manejo y su integraci\u00f3n con nuevas opciones tecnol\u00f3gicas, considerando
  especialmente los costos y beneficios de diferentes alternativas, y su valor para
  fortalecer las capacidades adaptativas de las poblaciones locales (especialmente
  aquellas m\u00e1s vulnerables) y el marco institucional.\\n- Es prioritario el desarrollo
  de an\u00e1lisis de vulnerabilidad que integren los componentes sociales, econ\u00f3micos,
  pol\u00edticos, biof\u00edsicos e institucionales y la generaci\u00f3n de indicadores
  para evaluar la capacidad adaptativa de las comunidades locales, los sistemas productivos
  andinos y la sociedad en general, con enfoques integrales que reflejen la complejidad
  de la adaptaci\u00f3n y el contexto en el que se desarrollan.\\n- El trabajo en
  el an\u00e1lisis de los modelos m\u00e1s efectivos de gobernanza y los cambios estructurales
  necesarios en las instituciones gubernamentales y no gubernamentales para la adaptaci\u00f3n
  sigue siendo un tema prioritario a pesar de los avances institucionales y normativos
  provenientes de la CMNUCC y su implementaci\u00f3n a escala nacional en la regi\u00f3n.
  Entender a la adaptaci\u00f3n como eje transversal en todas las actividades de desarrollo
  y no como un problema ambiental se ve reflejado con la necesidad de articular las
  pol\u00edticas de adaptaci\u00f3n intersectorialmente, a diferentes escalas y entre
  diversos actores.\\n- No se han dedicado los esfuerzos suficientes en comunicar
  la informaci\u00f3n sobre los impactos del cambio clim\u00e1tico sobre los socioecosistemas
  andinos, por lo que es prioritario contar con los mecanismos apropiados para poner
  la informaci\u00f3n disponible a disposici\u00f3n del p\u00fablico y sobretodo hacerla
  llegar de forma efectiva a tomadores de decisi\u00f3n. As\u00ed, sigue siendo una
  tarea pendiente el promover un di\u00e1logo m\u00e1s efectivo entre la ciencia y
  la pol\u00edtica y que las estrategias de adaptaci\u00f3n respondan de manera m\u00e1s
  clara a la evidencia cient\u00edfica sobre el impacto del cambio clim\u00e1tico
  en los socio-ecosistemas y sus respuestas.\\nCon la \\\"Cumbre Mundial de la Adaptaci\u00f3n\u201d,
  celebrada de forma virtual el 25 y 26 de enero del a\u00f1o en curso por invitaci\u00f3n
  del gobierno de los Pa\u00edses Bajos, ha comenzado la cuenta regresiva hacia la
  pr\u00f3ximo Conferencia Clim\u00e1tica de las Naciones Unidas COP 26 a fines del
  a\u00f1o.\\nM\u00e1s de 30 l\u00edderes y 50 ministros de diferentes pa\u00edses,
  acompa\u00f1ados de representantes de 50 organizaciones internacionales han estado
  presentes con mensajes de solidaridad, compromisos de financiamiento y anuncios
  de un sinfin de iniciativas de adaptaci\u00f3n y resiliencia clim\u00e1tica, dando
  una se\u00f1al fuerte a un entorno enfocado todav\u00eda principalmente en la mitigaci\u00f3n
  del cambio clim\u00e1tico.\\nToma de la conferencia virtual; la imagen de fondo
  muestra el sistema de alerta temprana en un pueblo de la costa de Mozambique; fuente:
  flickr CAS 2021\\n[leer m\u00e1s]La noticia clim\u00e1tica m\u00e1s importante del
  \u00faltimo a\u00f1o ha llegado al mundo de forma casi escondida: En un video de
  unos 15 minutos presentado en la Asamblea General de las Naciones Unidas en septiembre
  de 2020, el presidente chino Xi Jinping hizo un anuncio de unas pocas frases: China
  se propone la meta de ser neutral en materia de carbono antes de 2060.\\nEste anuncio
  significa dos cosas: Por una parte, el aumento de temperatura durante el siglo XXI
  se reducir\u00e1 entre 0,2 y 0,3 \u00b0C. Por otra parte, Xi Jinping ha colocado
  China en el liderazgo mundial de la lucha contra el cambio clim\u00e1tico.\\nEl
  mensaje de video del presidente chino a la Asamblea General de las NN. UU. en septiembre
  del a\u00f1o pasado. Fuente: news.un.org\\n[leer m\u00e1s]Estimad@s lector@s,\\nHa
  terminado un a\u00f1o dif\u00edcil, de grandes sobresaltos. La pandemia del COVID
  19 ha tomado al mundo por sorpresa, dominando las noticias, la atenci\u00f3n de
  muchos gobiernos y la vida de cada un@ de nosotr@s alrededor del globo.\\nEstamos
  comenzando este nuevo a\u00f1o 2021 con incertidumbre, pero tambi\u00e9n con esperanza.
  El deseo de much@s es \u201cvolver a lo de antes\u201d. Si pensamos en la posibilidad
  de estar cerca con amigos, con todos los seres humanos que amamos, compartimos este
  deseo de volver a \u201cla normalidad\u201d.\\nSin embargo, el parteaguas vivido,
  es tambi\u00e9n la ventana para observar la necesidad de una transformaci\u00f3n
  ecol\u00f3gica y social, el Klimablog renueva su apuesta a este camino de transformaci\u00f3n
  que toma fuerza alrededor de nuestro \u00fanico planeta.\\n[leer m\u00e1s]Para la
  celebraci\u00f3n de los 75 a\u00f1os de las Naciones Unidas el d\u00eda 21 de septiembre
  pasado, la organizaci\u00f3n internacional Oxfam public\u00f3 un informe que detalla
  c\u00f3mo, en las \u00faltimas d\u00e9cadas, \u201cla desigualdad extrema de las
  emisiones de carbono nos ha dejado al borde del colapso clim\u00e1tico\u201d.\\nPresentamos
  a continuaci\u00f3n el resumen de este importante estudio, que muestra con toda
  claridad, que la principal causa del cambio clim\u00e1tico es el consumo casi ilimitado
  del sector m\u00e1s afluente de la poblaci\u00f3n mundial: En los \u00faltimos 30
  a\u00f1os, el 10 % m\u00e1s rico de la poblaci\u00f3n mundial gener\u00f3 el 52
  % de las emisiones de carbono.\\n[leer m\u00e1s]Hay un crecimiento acelerado de
  lagunas glaciares debido al calentamiento global y el retroceso de los glaciares
  alrededor del mundo. Seg\u00fan un reciente estudio en base a im\u00e1genes satelitales,
  tanto el n\u00famero de lagunas glaciares como su volumen de agua ha aumentado en
  m\u00e1s de 50%durante los \u00faltimos 30 a\u00f1os.\\nCon este notable aumento
  de lagunas glaciares, tambi\u00e9n aumenta el peligro de la r\u00faptura de \u00e9stas,
  resultando en el vaciamiento repentino e inundaciones (glaciar lake outburst floods
  o \u201cGLOFs\u201d) con el potencial de causar considerables da\u00f1os en poblaciones
  e infraestructura r\u00edo abajo.\\nLaguna glaciar en la Cordillera Real de Bolivia\\n[leer
  m\u00e1s]Es sabido que en tiempos geol\u00f3gicos, el proceso natural de la meteorizaci\u00f3n
  de rocas (rock weathering) ha llevado al enfriamento del planeta debido a la paulatina
  reducci\u00f3n de la concentraci\u00f3n de di\u00f3xido de carbono en la atm\u00f3sfera.\\nAhora,
  un grupo de cient\u00edficos ha realizado el primer c\u00e1lculo exhaustivo para
  determinar el impacto de la aceleraci\u00f3n de este proceso mediante la aplicaci\u00f3n
  de polvo de roca s\u00edlice triturada en campos de cultivo en escala masiva: se
  podr\u00eda reducir las emisiones netas por entre 0,5 y 2 gigatoneladas de CO2.\\n[leer
  m\u00e1s]En las \u00faltimas semanas las temperaturas ya elevadas en Siberia durante
  meses han alcanzado nuevos niveles r\u00e9cord. En Verjoyansk, el lugar \\\"habitado
  m\u00e1s fr\u00edo del mundo\\\" se registr\u00f3 una temperatura de 38\u00b0 C.\\nCon
  esta ola de calor prolongada se crean condiciones perfectas para un mayor n\u00famero
  de incendios. Tambi\u00e9n se acelera el derretimiento del suelo permanentemente
  congelado o permafrost, poniendo en riesgo a gran parte de la infraestructura en
  el \u00c1rtico, lo que resulta en un mayor riesgo de cat\u00e1strofes ambientales
  en la industria extractivista de la regi\u00f3n.\\nAnomal\u00eda de la temperatura
  en mayo 2020 en el hemisferio norte. Fuente: NASA Earth Observatory\\n[leer m\u00e1s]En
  los Andes bolivianos, el cambio clim\u00e1tico est\u00e1 afectando el ritmo del
  retroceso de los glaciares, as\u00ed como los patrones de lluvia y la velocidad
  del viento. Estos factores de estr\u00e9s se suman a las presiones existentes que
  han llevado a la migraci\u00f3n de las zonas rurales a las zonas urbanas de monta\u00f1a,
  especialmente a las ciudades de La Paz y El Alto.\\nPresentamos a continuaci\u00f3n
  la versi\u00f3n en espa\u00f1ol del art\u00edculo \u201cAndes bolivianos: Interacci\u00f3n
  entre derretimiento glaciar y migraci\u00f3n\u201d (\u201cBolivian Andes: Interplay
  between glacier melting and outmigration\u201d) de Raoul Kaenzig y Dirk Hoffmann.\\nLa
  ciudad de La Paz subiendo a las monta\u00f1as\\n[leer m\u00e1s]La crisis global
  desatada por la pandemia del coronavirus es a la vez una emergencia sanitaria y
  una crisis socio-econ\u00f3mica de dimensiones todav\u00eda no calculables, pero
  que empiezan a vislumbrarse.\\nAunque en un primer momento el debate global sobre
  COVID-19 ha desplazado el otro debate global urgente, la emergencia clim\u00e1tica,
  ahora comienzan a escucharse voces que analizan los aprendizajes de la lucha contra
  la pandemia para la lucha contra el cambio clim\u00e1tico. Incluso hay personas
  que la ven como ventana de oportunidad para iniciar la transformaci\u00f3n hacia
  un mundo de \u201ccero carbono\u201d.\\nLa consigna de la COP 25 en Madrid, diciembre
