  porque es increible lo malos que son. Vaya puta mierda de monologos que te hacen...no
  se rien ni los socios del Madrid...\\npole\"", "\"14 febrero 2011\\nMe hice esta
  pregunta esta ma\u00f1ana, mientras miraba una sesi\u00f3n de fotos reciente que
  hab\u00eda realizado a mis hijas. Estaba orgulloso de haber inmortalizado la belleza
  e inocencia de mis dos ni\u00f1as. Pero, como siempre, empec\u00e9 a dar m\u00e1s
  vueltas sobre ello, yendo un poco m\u00e1s all\u00e1. Y pensaba en esas pizarras
  en blanco que pronto empezar\u00edan a llenarse de informaci\u00f3n que ser\u00eda
  determinante para definirlas individualmente.\\nMi hija mayor, In\u00e9s, ha desarrollado
  una afici\u00f3n (decir fijaci\u00f3n no estar\u00eda mal tampoco) bastante pronunciada
  por La Casa de Mickey Mouse, Dora la Exploradora, Angelina Ballerina y Jorge el
  Curioso, por nombrar a algunos shows de cartoons que, confesi\u00f3n de por medio,
  debo reconocer que nos libran de lidiar con los \u00edmpetus infantiles de una ni\u00f1a
  de dos a\u00f1os por espacios intermitentes de 25 minutos.\\nPaz, la menor, tiene
  un mundo un poco m\u00e1s reducido, limitado a su mam\u00e1 y a un grandul\u00f3n
  de cara peluda que la coge de vez en cuando y le dice \\\"yo soy tu pap\u00e1\\\".
  Sin embargo, lidia tambi\u00e9n con los sobresaltos que le generan los gritos y
  jalones de su inocentemente \\\"amorosa\\\" hermana. Sin embargo, pronto ir\u00e1
  descubriendo el mundo m\u00e1s all\u00e1 de su cuna.\\nUna de los aspectos m\u00e1s
  especiales de la infancia es \u00e9sa capacidad absolutamente pura para sorprenderse
  con las cosas que a nosotros los adultos embrutecidos nos parecen aburridas o carentes
  de importancia. El riesgo que corren, por eso, los peque\u00f1os es que son susceptibles
  a creer todo. Si viene de pap\u00e1, mam\u00e1 o cualquier figura paternal, ellos
  creer\u00e1n a rajatabla lo que sea, y esas verdades ir\u00e1n formando las bases
  de su individualidad futura. Por eso el t\u00edtulo del post, \u00bfle afectar\u00eda
  a mis hijas inculcarles que hay una mochila y un mapa que hablan (como en Dora la
  Exploradora) o un raton que habla y baila balett profesional (como Angelina Ballerina),
  todos m\u00e1s all\u00e1 de esa \\\"ventanita\\\" al mundo que es la TV?\\nComo
  dicen los abuelos, hay un momento para cada cosa. Obviamente, el ambiente y el colectivo
  al que pronto estar\u00e1n expuestas mis hijas les har\u00e1n entender y decepcionarse
  al descubrir que muchos de los personajes que cre\u00edan tan reales pertenecen
  a aquel mundo paralelo llamado imaginario, ciencia ficci\u00f3n. Sin embargo, otros
  personajes y sus mundos ficticios no les ser\u00e1n tan obviamente develados como
  tales.\\nLo peor de todo es que los personajes que el entorno fuerza a mantener
  \\\"reales\\\" son aquellos que sirven de mucho (sic) para facilitar la disciplina.
  Bajo lo que inocentemente hemos adoptado como \\\"no quebrarles la ilusi\u00f3n\\\",
  en el t\u00e9rmino m\u00e1s rom\u00e1ntico de la palabra, practicamos un condicionamiento
  (premio - castigo) como medio de formaci\u00f3n b\u00e1sica. \u00bfLe viene alguno
  a la mente?\\nTomemos como ejemplo al m\u00e1s pol\u00edticamente correcto, Pap\u00e1
  Noel. Este viejito es el encargado de llevar la cuenta de su comportamiento durante
  todo el a\u00f1o para decidir al final del mismo son dignos de recibir la ansiada
  bicicleta. Entonces, en la pr\u00e1ctica com\u00fan, se escucha com\u00fanmente,
  amenazas como \\\"Term\u00ednate el Mondongo que, si no, Pap\u00e1 Noel no te va
  a traer los patines que tanto quieres\\\" o \\\"Ponte los zapatos que te regal\u00f3
  la abuela que, si no, Papa Noel (que est\u00e1 al tanto de todo lo que haces) no
  te traer\u00e1 la bicicleta por Navidad\\\". Los ni\u00f1os, en su inocencia, son
  altamente sensibles a este tipo de mitos. Pasados cierta edad, aunque a\u00fan peque\u00f1os,
  se les va introduciendo a la idea de que ese mito con el que vivieron coaccionados
  durante unas cinco o seis navidades, fue gas, s\u00f3lo un bluff. Comprenden, conscientemente
  o no, que se han venido esforzando por ser \\\"buenos\\\", por nada. Y estoy seguro
  de que, psicol\u00f3gicamente, todos los que alguna vez cre\u00edmos en el gordo
  del Polo Norte (que en retrospectiva l\u00f3gica, en nuestra latitud deb\u00eda
  morir de shock t\u00e9rmico) y pasamos por el trance de entender que no exist\u00eda,
  sufrimos tremenda decepci\u00f3n de haber sido enga\u00f1ados por aquellos que m\u00e1s
  nos quieren (aunque procesado de un modo menos sofisticado, seguramente).\\nLa mentira
  viene disfrazada de muchas formas. No es necesario explicar por qu\u00e9 el ejemplo
  descrito es una violaci\u00f3n atroz de los \\\"valores\\\" que nos esforzamos por
  inculcarles a nuestros hijos. Afirmar que algo es verdad cuando sabemos que no lo
  es (o al menos que no nos consta que lo es), es mentir. Y con Papa Noel, a los hijos
  les mentimos.\\nPuede sonar banal y un gasto de teclado tratar de elaborar todo
  un discurso al efecto psicol\u00f3gico de creer en Pap\u00e1 Noel y luego entender
  que fuimos enga\u00f1ados por pap\u00e1 y mam\u00e1 (con la mejor de las intenciones).
  Sin embargo, hay otros ejemplos que son un poco m\u00e1s escabrosos, o \\\"incorrectos\\\"
  y que calzan perfecto en el modelo. Peor a\u00fan, convencionalmente, hay algunos
  de estos mitos que se nos afirman durante toda la vida, y vaya que nos la hacen
  de cuadritos.\\nEstos otros mitos (que a\u00fan no menciono), m\u00e1s institucionalizados,
  con curr\u00edcula, infraestructura a su servicio y hasta lo que interpretar\u00eda
  como manual de aplicaci\u00f3n pr\u00e1ctica incluidos, resultan siendo exactamente
  lo mismo. Estos mitos, por curioso que parezca, en muchos casos se infiltran tanto
  en el ideario colectivo que se institucionalizan, incluso por sobre la realidad
  misma. En estos casos, se obliga a \\\"seguirla\\\" (la mentira, claro) para evitar
  entrar en contradicci\u00f3n, lo que generar\u00eda un cisma en aquellos j\u00f3venes
  de 16 a\u00f1os con conciencia plena (habr\u00eda que aceptar que se les minti\u00f3
  durante 16 a\u00f1os). Por ejemplo, que un libro de texto de ciencias naturales
  afirme que mundo como lo conocemos tiene aproximadamente 6,000 a\u00f1os (y no billones),
  es una mentira, pero hay que \\\"seguirla\\\" para no confundir a \\\"los chicos\\\".
  Ense\u00f1arles que la reproducci\u00f3n tiene como requisito insoslayable al menos
  una relaci\u00f3n sexual pero que hay excepciones como la de una se\u00f1orita que
  copul\u00f3 con una luz y qued\u00f3 embarazada, es tambi\u00e9n una mentira. Decirles
  que los \u00fanicos seres capaces de desarrollar habilidades avanzadas de lenguaje
  hablado somos nosotros los homo sapiens pero que hay excepciones como la de una
  culebra sumamente inteligente (y mala) que existi\u00f3 hace un tiempo, tambi\u00e9n
  lo es.\\nRefraseando, afirmar que algo es verdad cuando sabemos que no lo es (o
  al menos que no nos consta que lo es), es mentir.\\nPor eso me siento incapaz de
  decepcionar a mis hermosas hijas. Vi\u00e9ndolas aqu\u00ed, \u00bf ser\u00eda Ud.
  capaz de enga\u00f1arlas tan descaradamente, cuando su confianza en Ud es infinita
  e inquebrantable?\\nYo, ni de a vainas.\\nSaludos,\\n1 comentarios:\\nNo doubt it''s
  a beautiful post of yours and you hve done a great job.\\nThanks for sharing it
  with us.\\nCertified Medical Assistant\\nPublicar un comentario en la entrada\"",
  "\"Rescatar a Ralph fue el primer paso, pero recuperar su confianza en las personas
  fue lo complicado\\nEl trabajo de un rescatador de perros no termina cuando el can
