  los amen, los cuiden y sean capaces de atender sus necesidades. A veces esto puede
  tomar meses, pero incluso con los casos m\u00e1s dif\u00edciles siempre se halla
  una soluci\u00f3n.\\nCuando Eldad lleg\u00f3 hasta donde se encontraba Ralph, en
  plena calle, su historia apenas hab\u00eda comenzado. Demoraron dos d\u00edas en
  poder tomar su confianza d\u00e1ndole comida para poder sacarlo del predio donde
