  mucha desconfianza hacia los seres humanos. Cuando lleg\u00f3 al centro de Hope
  For Paws, pudo recibir caricias y amor, y de a poco fue recuperando la confianza.
  Ahora Ralph vive contento con su nueva familia adoptiva.\"", "\"Fueron Inmaculada
